import React, { useState, useEffect } from "react";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  BarElement,
  Title,
  Tooltip,
  Legend
);

export default function DependenciasRurales(props) {
  const { cambio, url_base } = props;

  const labels = [];

  const data_dos = {
    labels,
    datasets: [
      {
        label: "Est. urbanos",
        data: valor_urbano,
        backgroundColor: "rgba(148,156,196,0.9)",
      },
      {
        stack: arbitraryStackKey2,
        label: "Est. rurales",
        data: valor_rural,
        backgroundColor: "rgb(172,108,52,0.9)",
      },
    ],
  };
  useEffect(() => {
    fetchApi();
  }, []);
  if (cambio) {
    return (
      <Bar
        height={250}
        options={{ maintainAspectRatio: false }}
        data={{
          labels,
          datasets: [
            {
              stack: arbitraryStackKey,
              label: "Est. urbanos",
              data: [1,2,3,4],
              backgroundColor: "rgba(148,156,196,0.9)",
            },
            {
              stack: arbitraryStackKey,
              label: "Est. rurales",
              data: v[1,2,3,4],
              backgroundColor: "rgb(172,108,52,0.9)",
            },
          ],
        }}
      />
    );
  }
  return (
    <Bar
      height={250}
      options={{ maintainAspectRatio: false }}
      data={data_dos}
    />
  );
}
